// src/App.js
import { BrowserRouter as Router, Route, NavLink } from "react-router-dom";
import { Routes } from "react-router";
import React from 'react';
import SimpleQuestion from "./SimpleQuestion";
import CompatibilityTab from "./CompatibilityTab";
import Logo from './logo.svg';
import "./App.css";

function App() {
  return (

      <div className="App">
        <header className="App-header">
          <img src={Logo} className="App-logo" alt="logo/"/>
          <h1>Voiance</h1>
          <Router>
          <nav className="Navigation">
            <ul className="ListNav">
              <li>
                <NavLink className="linkNav" style={({ isActive }) => ({
                            padding: isActive ? '10px;' : '10px',
                            borderRadius : isActive ? '5px' : '5px',
                            color: isActive ? '#fff' : '#545e6f',
                            background: isActive ? '#7600dc' : '#f0f0f0',
                            })}
                          to="/">
                  Accueil
                </NavLink>
              </li>
              <li>
                <NavLink className="linkNav" style={({ isActive }) => ({
                            padding: isActive ? '10px;' : '10px',
                            borderRadius : isActive ? '5px' : '5px',
                            color: isActive ? '#fff' : '#545e6f',
                            background: isActive ? '#7600dc' : '#f0f0f0',
                            })}
                          to="/CompatibilityTab">
                  Compatibilit√©
                </NavLink>
              </li>
              <li>
                <NavLink className="linkNav" style={({ isActive }) => ({
                            padding: isActive ? '10px;' : '10px',
                            borderRadius : isActive ? '5px' : '5px',
                            color: isActive ? '#fff' : '#545e6f',
                            background: isActive ? '#7600dc' : '#f0f0f0',
                            })}
                          to="/SimpleQuestion">
                  Question simple
                </NavLink>
              </li>
            </ul>
          </nav>
          <Routes>
            <Route path="/CompatibilityTab" element={<CompatibilityTab />} />
            <Route path="/SimpleQuestion" element={<SimpleQuestion />} />
          </Routes>
          </Router>
        </header>
      </div>

  );
}

export default App;
